import LoginForm from './logInForm';
import {Paper} from '@mui/material';
//import SignUpForm from '../signUp/layout';

function Login() {
  return (
    <Paper
      sx={{
        p: 2,
        margin: 'auto',
        maxWidth: 500,
        flexGrow: 1,
        backgroundColor: (theme) =>
          theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
      }}
      >
        <LoginForm />
      </Paper>
  );
  }

export default Login;
